(11418,'博客管理',1,'com.dimple.project.blog.blog.controller.BlogController.addSave()',1,'admin','','/blog/blog/add','125.69.76.87','四川 成都','{\"headerUrl\":[\"http://images.bianxiaofeng.com/3aeae4dc46b0f75fc7c4f89abc173f98\"],\"title\":[\"死磕MySQL——SQL查询语句的执行方式\"],\"summary\":[\"Service层包括连接器，查询缓存，分析器，优化器，执行器等，涵盖了大部分的核心功能，所有跨存储引擎的功能都在这一部分实现，比如存储过程SP，触发器Trigger，视图View等； 存储引擎负责数据的存储和提取。其架构是插件式的，支持InnoDB，MyISAM，Memory等多种存储引擎\"],\"tags\":[\"MySQL\"],\"categoryId\":[\"54\"],\"weight\":[\"0\"],\"content\":[\"<h1>前言</h1><p><br></p><p>Mysql架构示意图：<br></p><p><img src=\\\"http://images.bianxiaofeng.com/26a492c384cc7ecf0b68ced3ba65c0f6\\\" style=\\\"width: 50%;\\\"></p><p>MySQL可以分为Server层和存储引擎层两部分；</p><p>Service层包括连接器，查询缓存，分析器，优化器，执行器等，涵盖了大部分的核心功能，所有跨存储引擎的功能都在这一部分实现，比如存储过程SP，触发器Trigger，视图View等；</p><p>存储引擎负责数据的存储和提取。其架构是插件式的，支持InnoDB，MyISAM，Memory等多种存储引擎，MySQL5.5.5版本后成为默认的存储引擎；在创建表的时候可以使用engine=InnoDB 来执行创建表所使用的引擎；</p><h1>执行过程</h1><p>举例说明各个组件的工作方式及流程：</p><p>比如有以下一张表，DDL如下：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">CREATE TABLE `bg_link`  (\\n  `id` int(11) NOT NULL AUTO_INCREMENT,\\n)</code></pre><p>SQL语句：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">select * from T where id =10;</code></pre><h2>连接器</h2><p>第一步，先连上数据库，这个时候遇到的就是连接器。连接器负责与客户端建立连接，获取权限，维持和管理连接：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">mysql -uroot -p     </code></pre><p>然后输入密码，如果密码不正确，那么就会提示：Access denied for user，客户端程序结束运行；</p><p>如果密码正确，连接器会到权限表中查询出用户拥有的权限，之后，这个连接中所有的判断逻辑，都依赖于这个时候读到的权限；</p><p>连接完成后，如果没有后续的操作，那么就处于空闲状态，可以通过以下命令查看：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">show processlist</code></pre><p><img src=\\\"http://images.bianxiaofeng.com/18ebad814ff58915f92d17b2c407c4f9\\\" style=\\\"\\\"></p><p>如果客户端没有进一步的操作，那么连接器会自动断开，这个参数是由wait_timeout控制，默认时长为8h；</p><p>在连接断开后，如果客户端再操作，那么会提示：Lost connection to MySQL server during query;</p><h2>查询缓存</h2><p>连接建立完成，就可以执行select语句了，执行逻辑到第二步：查询缓存；</p><p>MySQL拿到一个请求后，会先查询缓存（之前执行过的语句及其结果会以key-value的方式存储在内存中，key是查询的语句，value是查询的结果），如果能够在缓存中查询到key，那么这个value就会直接返回客户端；</p><p>如果不在缓存中，那么就会执行到后面的阶段，执行完成后执行结果会被保存在缓存中。</p><p>注意：尽量不要对更新很频繁的表进行缓存操作：因为只要对一个表进行更新，那么这个表上的所有',0,NULL,'2019-04-11 19:58:27'),
