(11442,'博客管理',2,'com.dimple.project.blog.blog.controller.BlogController.editSave()',1,'admin','','/blog/blog/edit','125.69.76.87','四川 成都','{\"headerImg\":[\"http://images.bianxiaofeng.com/7725d208415a957e91facd27ec740cbb.png\"],\"title\":[\"Android Activity生命周期\"],\"summary\":[\"在Android开发的过程中，有一个特别重要的组件：Activity，它是除了Windows、Dialog和Toast之外我们用户可以直接看到的界面。本文主要记录下研究Activity中的一些感悟。首先Activity的生命周期总体来说可以分为两种：\"],\"tags\":[\"Android\"],\"categoryId\":[\"52\"],\"weight\":[\"0\"],\"content\":[\"<p><br></p>\\n<h1><a href=\\\"#前言\\\" name=\\\"前言\\\"></a>前言</h1>\\n<p>在Android开发的过程中，有一个特别重要的组件：Activity，它是除了Windows、Dialog和Toast之外我们用户可以直接看到的界面。本文主要记录下研究Activity中的一些感悟。<br>首先Activity的生命周期总体来说可以分为两种： </p>\\n<ul>\\n  <li>正常情况下的Activity生命周期</li>\\n  <li>\\n  <p>异常情况下的Activity生命周期<br></p>\\n  <h1><a href=\\\"#正常情况下的生命周期\\\" name=\\\"正常情况下的生命周期\\\"></a>正常情况下的生命周期</h1>\\n  <blockquote>\\n    <p>所谓的正常的生命周期是指：在有用户的参与的情况下，Activity经历的生命周期的改变。 </p>\\n  </blockquote></li>\\n</ul>\\n<p>首先上一张Activity的生命流程切换的图： </p>\\n<p><img src=\\\"http://p2sj58chj.bkt.clouddn.com/%7BmdFileName%7D-201835125748.png\\\" alt=\\\"{mdFileName}-201835125748\\\"> </p>\\n<h2><a href=\\\"#7种状态方法说明\\\" name=\\\"7种状态方法说明\\\"></a>7种状态方法说明</h2>\\n<p>接着对每个方法进行解释说明：<br> - onCreate()方法：——【**此时处于Activity在后台不可见**】<br> 表示Activity正在被创建，这是在Android开发中接触的最多的方法，比如常见的**setContentView()**加载布局资源，对控件和某些数字进行初始化等等。 </p>\\n<ul>\\n  <li>onStart()方法：——【**此时Activity在后台可见**】<br> 表示启动，此时的Activity已经是处于可见状态了，但是还没有出现在前台，所以还不能进行交互。</li>\\n  <li>onResume()方法——【**此时Activity在前台且可见**】<br> 表示Activity已经可见了，且出现在前台。和**onStart()和onResume()**方法的都是可见状态，但是**onResume()**方法表示工作在前台。</li>\\n  <li>\\n  <p>onPause()方法——【**此时Activity在前台可见**】 </p></li>\\n</ul>\\n<p>表示Activity即将终止，此时主要做一些比较耗时的操作，如相关资源回收等。 </p>\\n<ul>\\n  <li>\\n  <p>onDestroy()方法——【**Activity不可见**】<br>表示Activity即将被销毁，这是Activity的最后一个生命周期，在这里了可以做一些最终资源的回收和资源的释放工作等等。</p></li>\\n  <li>\\n  <p>onRestart()方法——【**Activity重新可见**】<br>表示Activity正在重新启动，触发条件为从不可见转为可见。比如从当前Activity回到上一个Activity，或者从桌面返回到应用程序中去。 </p></li>\\n</ul>\\n<h2><a href=\\\"#具体场景分析\\\" name=\\\"具体场景分析\\\"></a>具体场景分析</h2>\\n<ul>\\n  <li>Activity启动——Activity可见状态的回调情况：<br><code>onCreate()--onStart()--onResume();</code></li>\\n  <li>当打开新的Activity或者从当前Activity返回到桌面：</li>\\n  <li>当再次返回到原',0,NULL,'2019-04-12 11:08:41'),
(11443,'博客管理',2,'com.dimple.project.blog.blog.controller.BlogController.editSave()',1,'admin','','/blog/blog/edit','125.69.76.87','四川 成都','{\"headerImg\":[\"http://images.bianxiaofeng.com/3aeae4dc46b0f75fc7c4f89abc173f98\"],\"title\":[\"死磕MySQL——SQL查询语句的执行方式\"],\"summary\":[\"Service层包括连接器，查询缓存，分析器，优化器，执行器等，涵盖了大部分的核心功能，所有跨存储引擎的功能都在这一部分实现，比如存储过程SP，触发器Trigger，视图View等； 存储引擎负责数据的存储和提取。其架构是插件式的，支持InnoDB，MyISAM，Memory等多种存储引擎\"],\"tags\":[\"MySQL,执行方式\"],\"categoryId\":[\"54\"],\"weight\":[\"0\"],\"content\":[\"<h1>前言</h1><p><br></p><p>Mysql架构示意图：<br></p><p><img src=\\\"http://images.bianxiaofeng.com/26a492c384cc7ecf0b68ced3ba65c0f6\\\" style=\\\"width: 100%;\\\"></p><p>MySQL可以分为Server层和存储引擎层两部分；</p><p>Service层包括连接器，查询缓存，分析器，优化器，执行器等，涵盖了大部分的核心功能，所有跨存储引擎的功能都在这一部分实现，比如存储过程SP，触发器Trigger，视图View等；</p><p>存储引擎负责数据的存储和提取。其架构是插件式的，支持InnoDB，MyISAM，Memory等多种存储引擎，MySQL5.5.5版本后InnoDB成为默认的存储引擎；在创建表的时候可以使用engine=InnoDB 来执行创建表所使用的引擎；</p><h1>执行过程</h1><p>举例说明各个组件的工作方式及流程：</p><p>比如有以下一张表，DDL如下：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">CREATE TABLE `bg_link`  (\\n  `id` int(11) NOT NULL AUTO_INCREMENT,\\n)</code></pre><p>SQL语句：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">select * from T where id =10;</code></pre><h2>连接器</h2><p>第一步，先连上数据库，这个时候遇到的就是连接器。连接器负责与客户端建立连接，获取权限，维持和管理连接：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">mysql -uroot -p     </code></pre><p>然后输入密码，如果密码不正确，那么就会提示：Access denied for user，客户端程序结束运行；</p><p>如果密码正确，连接器会到权限表中查询出用户拥有的权限，之后，这个连接中所有的判断逻辑，都依赖于这个时候读到的权限；</p><p>连接完成后，如果没有后续的操作，那么就处于空闲状态，可以通过以下命令查看：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">show processlist</code></pre><p><img src=\\\"http://images.bianxiaofeng.com/18ebad814ff58915f92d17b2c407c4f9\\\" style=\\\"\\\"></p><p>如果客户端没有进一步的操作，那么连接器会自动断开，这个参数是由wait_timeout控制，默认时长为8h；</p><p>在连接断开后，如果客户端再操作，那么会提示：Lost connection to MySQL server during query;</p><h2>查询缓存</h2><p>连接建立完成，就可以执行select语句了，执行逻辑到第二步：查询缓存；</p><p>MySQL拿到一个请求后，会先查询缓存（之前执行过的语句及其结果会以key-value的方式存储在内存中，key是查询的语句，value是查询的结果），如果能够在缓存中查询到key，那么这个value就会直接返回客户端；</p><p>如果不在缓存中，那么就会执行到后面的阶段，执行完成后执行结果会被保存在缓存中。</p><p>注意：尽量不要对更新很频繁的表进行缓存操作：因为只要对一个表进行',0,NULL,'2019-04-12 11:09:45'),
