bc.ConnectionImpl.setAutoCommit(ConnectionImpl.java:2064)\\n\\t... 12 common frames omitted</code></pre><p><code class=\\\"language-java\\\">解决办法如下：</code></p><p><font color=\\\"#ca4440\\\" face=\\\"Menlo, Monaco, ',0,NULL,'2019-04-15 14:44:21'),
