(11461,'博客管理',1,'com.dimple.project.blog.blog.controller.BlogController.addSave()',1,'admin','','/blog/blog/add','222.210.50.206','四川 成都','{\"headerImg\":[\"http://images.bianxiaofeng.com/3aeae4dc46b0f75fc7c4f89abc173f98\"],\"title\":[\"MySQL创建用户与授权\"],\"summary\":[\"MySQL创建用户和授权的操作步骤，记录一下；\"],\"tags\":[\"MySQL,授权\"],\"categoryId\":[\"54\"],\"weight\":[\"0\"],\"content\":[\"<h1>显示所有用户</h1><p>在mysql这个数据库下面有一张user表存放的MySQL的用户的数据，查询方式如下：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">user mysql;\\nselect * from user;</code></pre><p>可以看到如下结果：</p><p><img src=\\\"http://images.bianxiaofeng.com/a87f2f1604eb00e161a7c1174282e3dc\\\" style=\\\"\\\"></p><p><br></p><p>上表就会列出所有的用户及权限；</p><p><br></p><h1>创建用户</h1><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">create user  \'user_name\'@\'host\'  identified by  \'password\'</code></pre><p>其中：</p><p>user_name：表示需要创建的用户的名称，也就是该用户的登录账号；</p><p>host：表示这个用户可以从那台机器上登录，如果只允许本机登录，可以设置为localhost，如果允许所有的远程机器登录，则可以设置为%，如果只允许特定IP登录，就可以设置具体的IP地址；</p><p>password：该用户登录的密码；</p><p>例子如下：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">create user \'test\'@\'localhost\' identified by \'123456\';//创建一个只能本地登录的test用户\\ncreate user \'test\'@\'192.168.0.123\' identified by \'123456\';//创建一个只能是特定IP登录的test用户\\ncreate user \'test\'@\'%\' identified by \'123456\'//创建一个可以任何IP地址登录的test用户</code></pre><p><br></p><p><br></p><p>用户创建完成后，需要授权才能使用；</p><h1>授权用户</h1><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">grant \'privileges\' on \'databaseName\'.\'tableName\' to \'username\'@\'host\'</code></pre><p>其中：</p><p>privileges：表示权限，可以有select、update、delete、insert等，如果是需要全部权限，使用ALL</p><p>\'databaseName\'.\'tableName\'：表示要具体授权给哪个数据库的哪张表，可以使用通配符* ，比如所有数据库的所有权限就应该写为*.*</p><p>\'username\'@\'host\'：表示授权给具体的用户</p><p>例如：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">grant select,insert  on test.test to \'test\'@\'%\';//授权test库中的test表的select和insert权限给test用户\\ngrant all  on test.test to \'test\'@\'%\';//授权test库中的test表的所有权限给test用户\\ngrant all  on test.* to \'test\'@\'%\';//授权test库中所有表的所有权限给test用户</code></pre><p>注意：</p><p>以上命令不能给授权的用户的授权权限，如果需要让该用户可以授权，那么需要使用以下命令：</p><pre class=\\\"prettyprint linenums\\\"><code cla',0,NULL,'2019-04-18 19:46:13'),
