test to \'test\'@\'%\';//授权test库中的test表的所有权限给test用户\\ngrant all  on test.* to \'test\'@\'%\';//授权test库中所有表的所有权限给test用户</code></pre><p>注意：</p><p>以上命令不能给授权的用户的授权权限，如果需要让该用户可以授权，那么需要使用以下命令：</p><pre class=\\\"prettyprint linenums\\\"><code class=\\\"language-java\\\">grant all  on test.',0,NULL,'2019-04-18 19:47:18'),
